import './App.css';
import Header from "./components/Header";
import Recipes from "./components/Recipes";

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <p>

         <Header/>
         <Recipes/>
        </p>

      </header>
    </div>
  );
}

export default App;
